import "./SearchResult.css";
import { useState } from "react";

export const SearchResult = ({ result }) => {
  const [titles,setTitles]=useState()
  const [igaz,setIgaz]=useState(false)
  function gomble() {
    document.getElementById("konyvvv").value = result
    var results=document.querySelectorAll(".search-result")
    var resultsList=document.querySelectorAll(".results-list")[0]
    results.forEach(entry=>{
      if(entry.innerText==result){
        setTitles(entry.innerText)
        setIgaz(true)
        results.forEach(value=>{
          value.innerHTML=""
        })
        resultsList.innerHTML=""
      }

      console.log(document.querySelectorAll(".search-result"))
    })
  }
  return (
    <div
      className="search-result"
      onClick={() => { gomble() }}
    >
      {igaz ? titles : result}
    </div>
  );
};
